import { Link } from "react-router-dom";

export default function AllTrip() {
  //Vou ser uma função de ver todas as viagens
  return (
    <div>
      <h1>Lista de viagens</h1>
      <Link to="/all-trip"><button>Ver viagens disponíveis</button></Link>

    </div>
  );
}
